import React from "react";
import eu from "../assets/eu.png";

const Intro = () => {
  return (
    <div className="sem0bg" id="Intro">
      <div className="duas-colunas">
        <div>
            <h2>Olá me chamo <div className="azul">Patrick Macêdo Felicio</div></h2>
        </div>
        <div>
            <img src={eu} alt="Patrick"/>
        </div>
      </div>
    </div>
  );
};

export default Intro;
